import React from "react";
import { useNavigate } from "react-router-dom";

// Images
import logoImg from "../assets/logo.jpg";
import heroImg from "../assets/hero.jpg";
import bridalImg from "../assets/bridal1.jpg";
import everydayImg from "../assets/everyday1.jpg";
import luxuryImg from "../assets/luxury1.jpg";

import "./home.css";


const Home = () => {
  const navigate = useNavigate();

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">
          <img src={logoImg} alt="Logo" className="logo-img" />
          Elegant Jewelry
        </div>
        <ul className="nav-links">
          <li>
            <a href="#" onClick={() => navigate("/")}>Home</a>
          </li>
          <li>
            <a href="#" onClick={() => navigate("/collections")}>Collections</a>
          </li>
          <li>
            <a href="#" onClick={() => navigate("/contact")}>Contact</a>
          </li>
        </ul>
      </nav>

      {/* Hero Section */}
      <section className="hero-section">
        <img src={heroImg} alt="Hero Jewelry" className="hero-img" />
        <div className="hero-text">
          <h1>Welcome to Elegant Jewelry</h1>
          <p>Discover exquisite collections crafted for every occasion</p>
          <button onClick={() => navigate("/collections")}>Shop Now</button>
        </div>
      </section>

      {/* Collections Section */}
      <section className="page-content">
        <div className="collections">
          <div onClick={() => navigate("/collections/bridal")} className="collection-card">
            <img src={bridalImg} alt="Bridal" />
            <h3>Bridal Collection</h3>
          </div>

          <div onClick={() => navigate("/collections/everyday")} className="collection-card">
            <img src={everydayImg} alt="Everyday" />
            <h3>Everyday Wear</h3>
          </div>

          <div onClick={() => navigate("/collections/luxury")} className="collection-card">
            <img src={luxuryImg} alt="Luxury" />
            <h3>Luxury Collection</h3>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="page-content" style={{ backgroundColor: "#333", color: "#fff", padding: "20px" }}>
        <p>Â© 2025 Elegant Jewelry. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
